		            JOIN FMM_Model_Group_Assign_Model Mod_Grp_Assgn
		            ON Mod_Grps.Cube_ID = Mod_Grp_Assgn.Cube_ID
		            AND Mod_Grps.Model_Group_ID = Mod_Grp_Assgn.Model_Group_ID
		            JOIN FMM_Models Modl
