                adapter.UpdateCommand.Parameters.Add("@Spread_Amount", SqlDbType.Decimal).SourceColumn = "Spread_Amount";
                adapter.UpdateCommand.Parameters.Add("@Spread_Curve", SqlDbType.NVarChar, 20).SourceColumn = "Spread_Curve";
