                #region "Copy Activity Data"
                foreach (DataRow activity_ConfigRow in src_FMM_Activity_Config_DT.Rows)
                {
                    BRApi.ErrorLog.LogMessage(si, "Hti Copy");
                    Copy_Activities(activity_ConfigRow, ref tgt_FMM_Activity_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                    // Access Activity_ID from the current activity_ConfigRow
                    var curr_srcActivityID = activity_ConfigRow["Activity_ID"] != DBNull.Value
                                            ? (int)activity_ConfigRow["Activity_ID"]
                                            : -1; // Handle null Activity_IDs as needed
                    foreach (DataRow unit_ConfigRow in src_FMM_Unit_Config_DT.Select($"Activity_ID = {curr_srcActivityID}"))
                    {
                        var curr_srcUnitID = unit_ConfigRow["Unit_ID"] != DBNull.Value
                        ? (int)unit_ConfigRow["Unit_ID"]
                        : -1; // Handle null Unit_IDs as needed
                        Copy_Units(unit_ConfigRow, ref tgt_FMM_Unit_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        foreach (DataRow acct_ConfigRow in src_FMM_Acct_Config_DT.Select($"Unit_ID = {curr_srcUnitID}"))
                        {
                            Copy_Accts(acct_ConfigRow, ref tgt_FMM_Acct_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        }
                    }
                    foreach (DataRow register_ConfigRow in src_FMM_Register_Config_DT.Select($"Activity_ID = {curr_srcActivityID}"))
                    {
                        var curr_srcRegisterConfigID = register_ConfigRow["Register_Config_ID"] != DBNull.Value
                        ? (int)register_ConfigRow["Register_Config_ID"]
                        : -1; // Handle null Unit_IDs as needed
                        Copy_Register_Config(register_ConfigRow, ref tgt_FMM_Register_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        foreach (DataRow col_ConfigRow in src_FMM_Register_Config_DT.Select($"Register_Config_ID = {curr_srcRegisterConfigID}"))
                        {
                            Copy_Col_Config(col_ConfigRow, ref tgt_FMM_Col_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        }
                    }
                    foreach (DataRow approval_ConfigRow in src_FMM_Approval_Config_DT.Select($"Activity_ID = {curr_srcActivityID}"))
                    {
                        var curr_srcApprovalID = approval_ConfigRow["Approval_ID"] != DBNull.Value
                        ? (int)approval_ConfigRow["Approval_ID"]
                        : -1; // Handle null Unit_IDs as needed
                        Copy_Approvals(approval_ConfigRow, ref tgt_FMM_Approval_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        foreach (DataRow approvalstep_ConfigRow in src_FMM_Approval_Step_Config_DT.Select($"Approval_ID = {curr_srcApprovalID}"))
                        {
                            Copy_Approval_Steps(approvalstep_ConfigRow, ref tgt_FMM_Approval_Step_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        }
                    }
                    foreach (DataRow models_ConfigRow in src_FMM_Models_DT.Select($"Activity_ID = {curr_srcActivityID}"))
                    {
                        var curr_srcModelID = models_ConfigRow["Model_ID"] != DBNull.Value
                        ? (int)models_ConfigRow["Model_ID"]
                        : -1; // Handle null Unit_IDs as needed
                        Copy_Models(models_ConfigRow, ref tgt_FMM_Models_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                        foreach (DataRow calc_ConfigRow in src_FMM_Calc_Config_DT.Select($"Model_ID = {curr_srcModelID}"))
                        {
                            BRApi.ErrorLog.LogMessage(si, "Hit Calc");
                            var curr_srcCalcID = calc_ConfigRow["OS_Calc_ID"] != DBNull.Value
                            ? (int)calc_ConfigRow["OS_Calc_ID"]
                            : -1; // Handle null Unit_IDs as needed
                            Copy_Calcs(calc_ConfigRow, ref tgt_FMM_Calc_Config_DT, tgt_Cube_ID, ref XFCopyTaskResult, "Calc Copy");
                            foreach (DataRow dest_ConfigRow in src_FMM_Dest_Cell_DT.Select($"OS_Calc_ID = {curr_srcCalcID}"))
                            {
                                Copy_Dest_Cell(dest_ConfigRow, ref tgt_FMM_Dest_Cell_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                            }
                            foreach (DataRow src_ConfigRow in src_FMM_Src_Cell_DT.Select($"OS_Calc_ID = {curr_srcCalcID}"))
                            {
                                Copy_Src_Cell(src_ConfigRow, ref tgt_FMM_Src_Cell_DT, tgt_Cube_ID, ref XFCopyTaskResult);
                            }
                        }
                    }
                }
                #endregion
                foreach (var Model_GroupRow in src_FMM_Model_Groups_DT.Rows)
                {

                }
                foreach (var WF_DU_ConfigRow in src_FMM_WF_DU_Config_DT.Rows)
                {

                }
                sql_Adapter_FMM_Activity_Config.Update_FMM_Activity_Config(si, tgt_FMM_Activity_Config_DT, sql_Data_Adapter_FMM_Activity_Config);
                sql_Adapter_FMM_Unit_Config.Update_FMM_Unit_Config(si, tgt_FMM_Unit_Config_DT, sql_Data_Adapter_FMM_Unit_Config);
                sql_Adapter_FMM_Acct_Config.Update_FMM_Acct_Config(si, tgt_FMM_Acct_Config_DT, sql_Data_Adapter_FMM_Acct_Config);
                sql_Adapter_FMM_Register_Config.Update_FMM_Register_Config(si, tgt_FMM_Register_Config_DT, sql_Data_Adapter_FMM_Register_Config);
                sql_Adapter_FMM_Col_Config.Update_FMM_Col_Config(si, tgt_FMM_Col_Config_DT, sql_Data_Adapter_FMM_Col_Config);
                sql_Adapter_FMM_Approval_Config.Update_FMM_Approval_Config(si, tgt_FMM_Approval_Config_DT, sql_Data_Adapter_FMM_Approval_Config);
                sql_Adapter_FMM_Approval_Step_Config.Update_FMM_Approval_Step_Config(si, tgt_FMM_Approval_Step_Config_DT, sql_Data_Adapter_FMM_Approval_Step_Config);
                sql_Adapter_FMM_Models.Update_FMM_Models(si, tgt_FMM_Models_DT, sql_Data_Adapter_FMM_Models);
                sql_Adapter_FMM_Calc_Config.Update_FMM_Calc_Config(si, tgt_FMM_Calc_Config_DT, sql_Data_Adapter_FMM_Calc_Config);
                sql_Adapter_FMM_Dest_Cell.Update_FMM_Dest_Cell(si, tgt_FMM_Dest_Cell_DT, sql_Data_Adapter_FMM_Dest_Cell);
                sql_Adapter_FMM_Src_Cell.Update_FMM_Src_Cell(si, tgt_FMM_Src_Cell_DT, sql_Data_Adapter_FMM_Src_Cell);
                sql_Adapter_FMM_Model_Group_Assign_Model.Update_FMM_Model_Group_Assign_Model(si, tgt_FMM_Model_Group_Assign_Model_DT, sql_Data_Adapter_FMM_Model_Group_Assign_Model);
                sql_Adapter_FMM_WF_DU_Config.Update_FMM_WF_DU_Config(si, tgt_FMM_WF_DU_Config_DT, sql_Data_Adapter_FMM_WF_DU_Config);
                sql_Adapter_FMM_WF_DU_Assign_Model_Group.Update_FMM_WF_DU_Assign_Model_Group(si, tgt_FMM_WF_DU_Assign_Model_Group_DT, sql_Data_Adapter_FMM_WF_DU_Assign_Model_Group);
                sql_Adapter_FMM_WF_DU_Config.Update_FMM_WF_DU_Config(si, tgt_FMM_WF_DU_Config_DT, sql_Data_Adapter_FMM_WF_DU_Config);
                sql_Adapter_FMM_Model_Groups.Update_FMM_Model_Groups(si, tgt_FMM_Model_Groups_DT, sql_Data_Adapter_FMM_Model_Groups);
                sql_Adapter_FMM_Cube_Config.Update_FMM_Cube_Config(si, tgt_FMM_Cube_Config_DT, sql_Data_Adapter_FMM_Cube_Config);
            }
        }

