                    existingRow["Status"] = src_WF_DU_Config_Row["Status"].ToString(); // Update status or other fields as needed
                    existingRow["Update_Date"] = DateTime.Now;
                    existingRow["Update_User"] = si.UserName; // or appropriate user context
                }
